import { connect } from "react-redux";
import { fetchTechnique } from "../reducers/technique.Reducer";
import Technique from "../components/Technique.Component";

const mapStateToProps = (state) => ({
  technique: state.technique.technique,
  isLoading: state.technique.isLoading,
  error: state.technique.error,
});

const mapActionToProps = { fetchTechnique };

export default connect(mapStateToProps, mapActionToProps)(Technique);
